Posted by <a title="http://www.pauric.net" href="http://www.pauric.net">Radiorental</a><img src="http://media.geocommons.com/platial/images/categories/ICON_punk_verD.gif"> 3625 N Mississippi, Portland, OR 97227The ReBuilding Center is a popular destination for homeowners, do-it-yourselfers, contractors, artists, and enthusiasts interested in building with affordable, environmentally low impact materials. With an inventory that changes by the hour, The ReBuilding Center is the largest non-profit used building materials resource in North America.


The Five Major Goals of The ReBuilding Center:
Contribute to the sustainability and health of our environment by diverting for reuse waste that would otherwise have been discarded into landfills;
Provide environmentally sound, affordable, quality used building and remodeling materials to people of all income levels;
Create livable-wage, local jobs for people of all backgrounds in an economically depressed area of our region;
Educate Oregonians about the environmental and community benefits of diverting waste for reuse and recycling; and
Provide stable funding for Our United Villages\' community enhancement work.<a title="Built for Community Mapping" href="http://www.platial.com"><img src="http://media.geocommons.com/platial/images/logotype_small.jpg"></a>
